    rt_outboundListBean.immediateFly = map['immediateFly'];
    return rt_outboundListBean;
  }

  static List<Rt_outboundListBean> fromMapList(dynamic mapList) {
    List<Rt_outboundListBean> list = new List(mapList.length);
    for (int i = 0; i < mapList.length; i++) {
      list[i] = fromMap(mapList[i]);
